import React from 'react'
import { useState, useEffect } from 'react'
import {Fragment} from 'react'

function Products() {
    const [product, setproduct] = useState();

    useEffect(() => {
        fetch('https://fakestoreapi.com/products')

            .then(res => res.json())
            .then(data => {
                setproduct(data)
            })  
    }, [])
    return (
        <Fragment >

         <h1>Products</h1>
         {}

    </Fragment>
    )
}

export default Products
